import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import './index.css';
import Market from './Market';
import { BrowserRouter } from 'react-router-dom';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

  <React.StrictMode>
    <App />
    <BrowserRouter>
      <Market />
    </BrowserRouter>
  </React.StrictMode>
);
